// src/pages/Home.js
import React from 'react';
import UserForm from '../components/UserForm';

const Home = () => {
    return (
        <div>
            <h1>Home Page</h1>
            <p>Welcome to the Home page!</p>
            <UserForm/>
        </div>
    );
};

export default Home;
